import React from 'react'

export default function Login_fct() {
    let email = null
    let password = null
    function onPost(e) {
        e.preventDefault()

        console.log(email);
        console.log();
    }



    function onChangeEmail(e) {
        e.preventDefault()
        email = e.target.value
        console.log('onChange');
    }
    function onChangePassword(e) {
        e.preventDefault()
        password = e.target.value
        console.log('onChange');
    }


    return (
        <div>
            <div>
                <h2>Connectez-vous</h2>
                <form onSubmit={onPost}>
                    <input
                    type="text"
                    name="email"
                    placeholder="email"
                    value={email}
                    onChange={onChangeEmail}
                    />
                    <br/>
                    <br/>
                    <input
                    type="text"
                    name="password"
                    placeholder="mot de passe"
                    value={password}
                    onChange={onChangePassword}
                    />
                    <br/>
                    <br/>
                    <button type="sumbit" style={{ border: 'none', background: '#f5cda2', borderRadius: '5px'}} >Se connecter</button>
                </form>
            </div>
        </div>
    )
}
